【商品説明】<br>●片手でパチッとワンタッチで簡単に開け閉めが出来る袋用クリップです。<br>●耐久性に優れているため、丈夫で繰り返し使用できます。<br>●電子レンジや冷凍庫内での使用も可能です。<br>商品区分：日用雑貨品・他<br>原産国：日本<br>商品サイズ：105×243×15<BR><br>JANコード：4901422380533<BR>cs：100<BR><br>商品区分：日用雑貨品・他<br>原産国：日本<br><br><br>「パチック M 3個」は、指で押すだけで、片手で簡単に開け閉めできる保存用クリップです。耐久性に優れ、繰り返し使えます。袋の口を束ねてはさむだけなので、小さな袋から大きな袋まで幅広く使えます。カラフルでたのしく使い分け可能。電子レンジ・冷蔵庫内でも安心して使えます。滑り止め加工だから開けやすく、グイっと曲がるから軽い力で開きます。また親指にフィットする形なので閉めやすい、パチックのこだわり設計を採用しています。しっかり留めたいふくろにも。<br><br>使用上の注意<br><br>●袋の口を留めたままレンジ加熱をしないでください。袋内の空気が膨張し破裂の恐れがります。<br>●加熱後の取り扱いはやけどに十分ご注意ください。<br>●食品と直接接触させないでください。耐熱温度を超えることがあります。<br>●電子レンジの取扱説明書に従ってご使用ください。<br>●オート加熱・おまかせ加熱で使用しないでください。<br>●直火・オーブン・グリルで使用しないでください。<br>●熱で変形したり発煙・発火した場合はすぐに使用を中止してください。<br>●火のそばに置かないでください。<br><br>ご注意<br><br>●本品は、食品衛生法の規定に基づく「食品、添加物等の規格基準」に適合しています。<br>※折り返し部分が白っぽく見えることがありますが、機能には支障ありません。<br><br>品質表示<br><br>材質：ポリプロピレン、ポリエチレン<br>耐熱温度：110度<br><br>原産国<br><br>日本<br><br>お問い合わせ先<br><br>株式会社 クレハ お客様相談室<br>TEL.0120-03-9080<br>9：00-12：00/12：45-17：30(土曜、日曜、祝日を除く)<br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
